import React, { Component } from 'react';

class JSONcontainer extends Component {
    render() {
        let wireframe = this.props.wireframe;
        let controls = wireframe.controls
        return(
            <div id="JSONcontainer" className="container" style={{height: wireframe.container.height, width: wireframe.container.width}}>
                {controls && controls.map((controls) => {
                    if(controls.type === "label"){
                        console.log("LABEL");
                        <div className="btn-large-flat" style={{textAlign: "center"}}>Prompt for Input:</div>
                    }
                })}
            </div>
        )
    }
}

export default (JSONcontainer)
